import React from "react";
import "./styles/biggestWinsLosses.css";

const BiggestWinsLosses = ({ topProfitableTrades }) => {
  console.log(topProfitableTrades);
  return (
    <div className="wins-lost">
      <div className="card">
        <p>P/L</p>
        <p className="menu">::</p>
      </div>
      <div className="card-list">
        <ul className="cards">
          {topProfitableTrades.map((trade, index) => (
            <li className="card-item" key={index}>
              <div className="card-content">
                <p>{trade.option_symbol}</p>
                <p>${(trade.profit * 100).toFixed(2)}.00</p>
                <p>${(trade.percentage_differences * 100).toFixed(2)}.00</p>
              </div>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default BiggestWinsLosses;

